import React from "react";
import { Link } from "react-router-dom";

const Navigation = () => {
  return (
    <nav>
      <Link to="/">
        <img src="/images/Vector(2).png" alt="logo" />
        <span>codershouse</span>
      </Link>
    </nav>
  );
};

export default Navigation;
